'use strict';

require('ui/directives/input_focus');

require('ui/modules').get('app/sense').directive('senseSettings', function () {
  return {
    restrict: 'E',
    template: require('./settings.html'),
    controllerAs: 'settings',
    controller: function controller($scope, $element) {
      var _this = this;

      var settings = require('../settings');

      this.vals = settings.getCurrentSettings();
      this.apply = function () {
        _this.vals = settings.updateSettings(_this.vals);
        $scope.kbnTopNav.close();
      };

      var self = this;

      function onEnter(event) {
        if (event.which === 13) {
          self.apply();
        }
      }

      var boundElement = $element.bind('keydown', onEnter);
      $scope.$on('$destroy', function () {
        return boundElement.unbind('keydown', onEnter);
      });
    }
  };
});
